import { Button } from '@material-ui/core'
import { makeStyles } from '@material-ui/styles'
import React from 'react'
import FormDiv from '../../components/FormDiv'
import TextFieldComp from '../../components/TextFieldComp'

function AddNewServingScreen() {


    const useStyles = makeStyles(theme => ({
        title: {
            ...theme.typography.content,
            textAlign: 'center',
            fontSize: '2.5rem',
            marginTop: '20px'
        },
        formDiv: {
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            height: 'auto',
            width: '400px',
            backgroundColor: theme.palette.secondary.light,
            marginTop: '30px',
            marginBottom: '30px',
            borderRadius: '15px',
            flexDirection: 'column',
            paddingTop: '50px',
            paddingBottom: '50px',
        },
        label: {
            ...theme.typography.title,
            fontSize: '1.5rem'
        },
        btn: {
            ...theme.buttonDef
        },
        btnser: {
            ...theme.buttonDef,
            marginLeft: 'auto',
            marginRight: '20px'
        },
        btnLeft: {
            poaition: 'relative',
            marginRight: 'auto',
            marginLeft: '20px'
        }
    }))
    const classes = useStyles()
    const data = [{
        name: 'Username',
        placeholder: ''
    },
    {
        name: 'Name',
        placeholder: ''
    },
    {
        name: 'Address',
        placeholder: ''
    },
    {
        name: 'City',
        placeholder: ''
    },
    {
        name: 'Country',
        placeholder: ''
    },
    {
        name: 'State',
        placeholder: ''
    },
    {
        name: 'Pincode',
        placeholder: ''
    },
    ]

    return (
        <div>
            <p className={classes.title} >Add new Serving</p>
            <div className={classes.formDiv} >
                <FormDiv
                    data={data}
                />
                <Button variant='contained' color='primary'
                    className={classes.btn}  >Create Serving</Button>
            </div>
        </div>
    )
}

export default AddNewServingScreen
